import React, { Component } from 'react'
import styled from 'styled-components';

const StyledHeroFinalResolve = styled.div`

            margin:0;
            padding: 0;


            #container {
                position:absolute;
                background-color: blue;
                width: 100vw;
                height: 400px;
                top:0;
                left:0;
                }
            #elem{
                width: 32vw;
                height:25vh;
                position: absolute;
                background-color: green;
                -webkit-user-select: none;
                -moz-user-select: none;
                -o-user-select: none;
                -ms-user-select: none;
                -khtml-user-select: none;     
                user-select: none;
            }
`;
export class HeroFinalResolve extends Component {
  render() {
    return (
      <StyledHeroFinalResolve>
           <div id='container'>     
            <div id="elem" onmousedown='mydragg.startMoving(this,"container",event);' onmouseup='mydragg.stopMoving("container");'>
                <div>
                <select id="test">
                    <option value="1"/>first
                    <option value="2"/>second
                </select>
                <input type="text" value="123" />
                </div>
            </div>
        </div>
      </StyledHeroFinalResolve>
    )
  }
}

export default HeroFinalResolve
